import React from 'react';
import { Tab } from '@headlessui/react';
import {
  DocumentTextIcon,
  ShieldCheckIcon,
  ExclamationTriangleIcon,
  DocumentMagnifyingGlassIcon,
} from '@heroicons/react/24/outline';

function classNames(...classes) {
  return classes.filter(Boolean).join(' ');
}

const AnalysisResults = ({ results }) => {
  const tabs = [
    {
      name: 'Summary',
      icon: DocumentTextIcon,
      content: (
        <div className="prose max-w-none">
          <h3 className="text-lg font-medium text-gray-900">Document Summary</h3>
          <p className="mt-2 text-gray-600">{results.summary}</p>
        </div>
      ),
    },
    {
      name: 'Compliance',
      icon: ShieldCheckIcon,
      content: (
        <div>
          <h3 className="text-lg font-medium text-gray-900">Compliance Analysis</h3>
          <div className="mt-4 grid grid-cols-1 gap-4 sm:grid-cols-2">
            {Object.entries(results.compliance_analysis.categories).map(([category, score]) => (
              <div
                key={category}
                className="bg-white overflow-hidden shadow rounded-lg"
              >
                <div className="px-4 py-5 sm:p-6">
                  <dt className="text-sm font-medium text-gray-500 truncate">
                    {category.toUpperCase()}
                  </dt>
                  <dd className="mt-1 text-3xl font-semibold text-gray-900">
                    {Math.round(score * 100)}%
                  </dd>
                </div>
              </div>
            ))}
          </div>
        </div>
      ),
    },
    {
      name: 'Gaps',
      icon: ExclamationTriangleIcon,
      content: (
        <div>
          <h3 className="text-lg font-medium text-gray-900">Compliance Gaps</h3>
          <div className="mt-4 space-y-4">
            {results.compliance_analysis.compliance_gaps.map((gap, index) => (
              <div
                key={index}
                className="bg-white shadow sm:rounded-lg"
              >
                <div className="px-4 py-5 sm:p-6">
                  <h4 className="text-base font-semibold text-gray-900">
                    {gap.category.toUpperCase()}
                  </h4>
                  <div className="mt-2">
                    <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium
                      ${gap.severity === 'high' ? 'bg-red-100 text-red-800' : 'bg-yellow-100 text-yellow-800'}`}>
                      {gap.severity.toUpperCase()}
                    </span>
                  </div>
                  <ul className="mt-3 list-disc list-inside text-sm text-gray-500">
                    {gap.missing_terms.map((term, i) => (
                      <li key={i}>{term}</li>
                    ))}
                  </ul>
                </div>
              </div>
            ))}
          </div>
        </div>
      ),
    },
    {
      name: 'Entities',
      icon: DocumentMagnifyingGlassIcon,
      content: (
        <div>
          <h3 className="text-lg font-medium text-gray-900">Extracted Entities</h3>
          <div className="mt-4 grid grid-cols-1 gap-4 sm:grid-cols-2 lg:grid-cols-3">
            {results.compliance_analysis.entities.map((entity, index) => (
              <div
                key={index}
                className="bg-white overflow-hidden shadow rounded-lg"
              >
                <div className="px-4 py-5 sm:p-6">
                  <dt className="text-sm font-medium text-gray-500 truncate">
                    {entity.label}
                  </dt>
                  <dd className="mt-1 text-sm text-gray-900">
                    {entity.text}
                  </dd>
                </div>
              </div>
            ))}
          </div>
        </div>
      ),
    },
  ];

  return (
    <div className="bg-white shadow rounded-lg">
      <Tab.Group>
        <Tab.List className="flex space-x-1 rounded-t-lg bg-gray-100 p-1">
          {tabs.map((tab) => (
            <Tab
              key={tab.name}
              className={({ selected }) =>
                classNames(
                  'w-full rounded-lg py-2.5 text-sm font-medium leading-5',
                  'ring-white ring-opacity-60 ring-offset-2 ring-offset-primary-400 focus:outline-none focus:ring-2',
                  selected
                    ? 'bg-white text-primary-700 shadow'
                    : 'text-gray-600 hover:bg-white/[0.12] hover:text-primary-600'
                )
              }
            >
              <div className="flex items-center justify-center space-x-2">
                <tab.icon className="h-5 w-5" />
                <span>{tab.name}</span>
              </div>
            </Tab>
          ))}
        </Tab.List>
        <Tab.Panels className="p-6">
          {tabs.map((tab, idx) => (
            <Tab.Panel
              key={idx}
              className={classNames(
                'rounded-xl bg-white p-3',
                'ring-white ring-opacity-60 ring-offset-2 ring-offset-primary-400 focus:outline-none focus:ring-2'
              )}
            >
              {tab.content}
            </Tab.Panel>
          ))}
        </Tab.Panels>
      </Tab.Group>
    </div>
  );
};

export default AnalysisResults;
